-- Get airport IDs
SET @male_airport_id = (SELECT id FROM airports WHERE iataCode = 'MLE' LIMIT 1);
SET @gan_airport_id = (SELECT id FROM airports WHERE iataCode = 'GAN' LIMIT 1);
SET @had_airport_id = (SELECT id FROM airports WHERE iataCode = 'HAD' LIMIT 1);
SET @mam_airport_id = (SELECT id FROM airports WHERE iataCode = 'MAM' LIMIT 1);
SET @kdh_airport_id = (SELECT id FROM airports WHERE iataCode = 'KDH' LIMIT 1);
SET @thm_airport_id = (SELECT id FROM airports WHERE iataCode = 'THM' LIMIT 1);

-- Insert airport routes from Malé (MLE) to islands
INSERT INTO airport_routes (airportId, islandGuideId, transportType, distance, duration, price, frequency, operatingDays, description, isPopular, published) 
SELECT @male_airport_id, id, 'speedboat', '25 km', '30 mins', 5000, 'Multiple times daily', 'Daily', 'Speedboat transfer from Malé International Airport', 1, 1 FROM island_guides WHERE slug IN ('thulusdhoo-island', 'kandooma-island', 'fulidhoo-island', 'rasdhoo-island', 'veligandu-island', 'ukulhas-island', 'dhigurah-island', 'maafushi-island');

-- Insert airport routes from Maamigili (MAM) to southern islands
INSERT INTO airport_routes (airportId, islandGuideId, transportType, distance, duration, price, frequency, operatingDays, description, isPopular, published) 
SELECT @mam_airport_id, id, 'speedboat', '20 km', '20 mins', 3000, 'Daily', 'Daily', 'Speedboat transfer from Maamigili Airport', 1, 1 FROM island_guides WHERE slug IN ('dhigurah-island', 'fulidhoo-island', 'felidhoo-island');

-- Insert airport routes from Gan (GAN) to southern atolls
INSERT INTO airport_routes (airportId, islandGuideId, transportType, distance, duration, price, frequency, operatingDays, description, isPopular, published) 
SELECT @gan_airport_id, id, 'speedboat', '45 km', '45 mins', 4000, 'Daily', 'Daily', 'Speedboat transfer from Gan International Airport', 1, 1 FROM island_guides WHERE slug IN ('naifaru-island', 'hinnavaru-island');

